import React from 'react';
import { Link } from 'react-router-dom';

const Player = (props) => {
  return (
    <ul>
      {props.data.map((item) =>
        <li key={item.index} ><a href={`/players/${item.id}`}>Score: {item.score}</a></li>
      )}
    </ul>
  );
}

export default Player;

<Nav.Link><Link to="/">Home</Link></Nav.Link>
